INSERT INTO `t2_cmip6_exps` VALUES (1,'ssp245-GHG','Extension of well-mixed GHG-only run (hist-GHG) under SSP2-4.5 forcing to the year 2100. Models with interactive chemistry schemes should either turn off the chemistry or use a preindustrial climatology of stratospheric and tropospheric ozone in their radiation schemes.','f16d9740-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL,'DAMIP','AER,CHEM,BGC','2100','well-mixed GHG-only SSP2-4.5 run','ssp245-GHG','80','DAMIP','hist-GHG','AOGCM','2021','none',NULL,NULL),(2,'dcppA-historical-niff','A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year).  Radiative and other forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state value or projected in a simple way.  No inclusion of volcano or other short term forcing unless available at initial time. Initialise from the historical simulation. Run each member for at least 5 years, preferably 10 years.','f16dc6f2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','5 - 1','hindcast initialized from historical climate simulation but without using knowledge of subsequent historical forcing','dcppA-historical-niff','5','CMIP','historical','AOGCM','A ye','s1960,s1961,s1962,s1963,s1964,s1965,s1966,s1967,s1968,s1969,s1970,s1971,s1972,s1973,s1974,s1975,s1976,s1977,s1978,s1979,s1980,s1981,s1982,s1983,s1984,s1985,s1986,s1987,s1988,s1989,s1990,s1991,s1992,s1993,s1994,s1995,s1996,s1997,s1998,s1999,s2000,s2001,s2002,s2003,s2004,s2005,s2006,s2007,s2008,s2009,s2010,s2011,s2012,s2013,s2014,s2015,s2016',NULL,NULL),(3,'piClim-histall','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing to be consistent with historical forcing used in the DAMIP hist-all experiment and future forcing to be consistent with the ScenarioMIP SSP2 RCP4.5 scenario forcing.  A small ensemble of three simulations from 1850-2100.','f16f32a8-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL,'RFMIP','AER,CHEM,BGC','2100','transient effective radiative forcing','piClim-histall','251','CMIP','piControl','AGCM','1850','none',NULL,NULL),(4,'piClim-OC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of organic carbon (OC). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don\'t model the ozone interactively.','70e43d4c-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','CHEM,BGC','','pre-industrial climatological SSTs and forcing, but with 2014 organic carbon emissions','piClim-OC','30','CMIP','piControl','AGCM,AER','','none',NULL,NULL),(5,'aqua-p4K','Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7c. Aquaplanet (no land) experiment with CO2 set to the AMIP mean concentration and no seasonal cycle.  Impose a uniform +4K perturbation to the zonally uniform SSTs of the aquaControl, on a planet without continents.','f16d4c86-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL,'CFMIP','AER,CHEM','','aquaplanet with uniform 4K SST increase','aqua-p4K','10','no parent','no parent','AGCM','','none',NULL,NULL),(6,'ssp434','Gap: Mitigation scenario with low radiative forcing by the end of the century.  Following approximately RCP3.4 global forcing pathway with SSP4 socioeconomic conditions. Radiative forcing reaches a level of 3.4 W/m2 in 2100. Concentration-driven.','f16f68b8-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL,'ScenarioMIP','AER,CHEM,BGC','2100','gap-filling scenario reaching 3.4 based on SSP4','ssp434','86','CMIP','historical','AOGCM','2015','none',NULL,NULL),(7,'dcppC-ipv-pos','Restore the Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dd9b2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','','idealized positive IPV anomaly pattern','dcppC-ipv-pos','10','CMIP','piControl','AOGCM','','none',NULL,NULL),(8,'dcppC-ipv-NexTrop-pos','Restore the extra-tropical north Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dea60-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','','idealized positive northern extratropical IPV anomaly pattern','dcppC-ipv-NexTrop-pos','10','CMIP','piControl','AOGCM','','none',NULL,NULL),(9,'piClim-2xDMS','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The oceanic DMS (dimethyl sulphide) aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e44a80-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','CHEM,BGC','','pre-industrial climatological SSTs and forcing, but with doubled emissions of DMS','piClim-2xDMS','30','CMIP','piControl','AGCM,AER','','none',NULL,NULL),(10,'amip-hist','Extended AMIP run that covers 1870-2014. All natural and anthropogenic historical forcings as used in CMIP6 Historical Simulation will be included. AGCM resolution as CMIP6 Historical Simulation. The HadISST data will be used.  Minimum number of integrations is 3, more realisations are encouraged.','f16e1cba-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL,'GMMIP','AER,CHEM,BGC','2014','AMIP-style simulation covering the period 1870-2014','amip-hist','145','no parent','no parent','AGCM','1870','none',NULL,NULL),(11,'spinup-1950','The HighResMIP equivalent of the pre-industrial spinup with fixed 1950s forcing. The forcing consists of greenhouse gases, including ozone and aerosol loading for a 1950s (~10 year mean) climatology. For optimal comparison between models, use of plume aerosol concentrations is recommended (rather than emissions). Initial ocean conditions are taken from the EN4 (Good et al, 2013) ocean analysis over an average period of 1950-1954.  This spinup is short compared to DECK (30-50 years for example, to be manageable and consistent across resolutions) to produce initial conditions for control-1950 and hist-1950. At least one ensemble member for each resolution used int he coupled simulations (i.e. standard and high), where high is minimum atmosphere 25-50 km at mod-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. Run for 30-50 years. ','6131ba78-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL,'HighResMIP','AER','','coupled spinup with fixed 1950s forcings from 1950 initial conditions (with ocean at rest) to provide initial condition for control-1950 and hist-1950','spinup-1950','30','no parent','no parent','AOGCM','','none',NULL,NULL),(12,'piSST-4xCO2-solar','Time slice for the first year of the GeoMIP G1 experiment with fixed sea surface temperature climatology calculated from the piControl. Run for 10 years.','f16e41fe-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL,'GeoMIP','AER,CHEM','','preindustrial control SSTs with quadrupled CO2 and solar reduction','piSST-4xCO2-solar','10','CMIP','piControl','AGCM','','none',NULL,NULL),(13,'faf-all','Simultaneously apply anomalous fluxes of windstress, heat and freshwater using the passive-tracer method for heat as in the faf-heat experiment. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e19ea-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL,'FAFMIP','AER,CHEM,BGC','','control plus perturbative surface fluxes of momentum, heat and water into ocean','faf-all','70','CMIP','piControl','AOGCM','','none',NULL,NULL),(14,'ssp126','SSP-based RCP scenario with low radiative forcing by the end of the century.  Following approximately RCP2.6 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 2.6 W/m2 in 2100. Concentration-driven.','f16f6188-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL,'ScenarioMIP','AER,CHEM,BGC','2100 ','update of RCP2.6 based on SSP1','ssp126','86','CMIP','historical','AOGCM','2015','none',NULL,NULL),(15,'ism-1pctCO2to4x-self','Stand alone ice sheet model driven offline by a CMIP6 model with 1% per year atmospheric carbon dioxide increased to quadrupling then held fixed for 200 years. Run for a minimum of 350 years (500 years encouraged).  The ice sheet model should be configured with the same settings as the ice sheet model in the ipctCO2to4x-withism experiment and should use the same initial conditions.','f16e7c14-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL,'ISMIP6','','','offline ice sheet model forced by ISM\'s own AOGCM 1pctCO2to4x output','ism-1pctCO2to4x-self','350','ISMIP6','ism-piControl-self','ISM','','none',NULL,NULL),(16,'G6SST1','Time slice for the first year of the ScenarioMIP SSP5-85 (high forcing scenario) experiment. Run for 10 years.','f16e48d4-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL,'GeoMIP','AER,CHEM','','SSTs, forcings, and other prescribed conditions from year 2020 of SSP5-8.5','G6SST1','10','ScenarioMIP','ssp585','AGCM','','none',NULL,NULL),(17,'ism-piControl-self','Stand alone ice sheet model driven offline by a CMIP6 model with piControl forcing. The ice sheet model should be configured with the same settings as the ice sheet model in the piControl-withism experiment and should use the same initial conditions.','f16e714c-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL,'ISMIP6','','','offline ice sheet forced by ISM\'s own AOGCM piControl output','ism-piControl-self','500','no parent','no parent','ISM','','none',NULL,NULL),(18,'rad-irf','Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions. Use RFMIP specified atmospheric distributions of temperature and humidity and surface properties over many profiles.','f16f178c-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL,'RFMIP','','','offline assessment of radiative transfer parmeterizations in clear skies','rad-irf','','no parent','no parent','RAD','','none',NULL,NULL),(19,'dcppC-pac-control','Restore the Pacific sea surface temperature to the model control run climatology.  Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.','f16dd728-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','','idealized Pacific control','dcppC-pac-control','10','CMIP','piControl','AOGCM','','none',NULL,NULL),(20,'piClim-NH3','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of ammonia (NH3). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don\'t model the ozone interactively.','70e44094-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','CHEM,BGC','','pre-industrial climatological SSTs and forcing, but with 2014 ammonia emissions','piClim-NH3','30','CMIP','piControl','AGCM,AER','','none',NULL,NULL),(21,'G1','Extended version of GeoMIP experiment G1 (Kravitz et al., 2011). Beginning from a preindustrial control simulation (picontrol) the net top of atmosphere (TOA) radiative flux imbalance due to an abrupt quadrupling of the CO2 concentration (abrupt4xCO2) would be balanced via a reduction in total solar irradiance. Here, \"balance\" is defined as  the global mean value of top-of-atmosphere net radiative flux being within +-0.1 W/m2 of the piControl experiment over an average of years 1-10 of the simulation. The G1 experiment should be run for 50 years, however modelling groups that are not able to extend their previous (G1) model simulation should run the CMIP6 G1 experiment for the full 100 years. ','f16e30e2-dd9e-11e6-b89b-ac72891c3257','GeoMIP',NULL,'01.00.28',NULL,'GeoMIP','AER,CHEM,BGC','','abrupt quadrupling of CO2 plus reduction in total solar irradiance','G1','100','CMIP','piControl','AOGCM','','none',NULL,NULL),(22,'volc-long-hlN','Idealised high-latitude (60N) northern hemisphere eruption corresponding to an initial emission of 28.1 Tg of SO2 (equal to half the total amount injected for volc-long-eq).  volc-long-hlN is not directly comparable to the 1783-84 Laki eruption since it does not try to reproduce the very specific characteristics of Laki. The experiment is designed to span very different initial climate states to systematically assess uncertainties in post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer (50 years) to cover the multi-decadal oceanic response. Initialisation date from the piControl start year is 1st April.','f16fa22e-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL,'VolMIP','AER,CHEM,BGC','','idealized Northern Hemisphere high-latitude eruption emitting 28.1 Tg of SO2','volc-long-hlN','20','CMIP','piControl','AOGCM','','none',NULL,NULL),(23,'esm-hist-ext','Extension beyond 2014 of the CMIP6 historical simulation with atmospheric CO2 concentration calculated. To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.','f16fd136-dd9e-11e6-b89b-ac72891c3257','CMIP',NULL,'01.00.28',NULL,'CMIP','AER,CHEM','','post-2014 all-forcing simulation with atmospheric CO2 concentration calculated','esm-hist-ext','1','CMIP','esm-hist','AOGCM,BGC','2015','none',NULL,NULL),(24,'piClim-VOC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of CO/VOC, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total.','70e435d6-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','BGC','','pre-industrial climatological SSTs and forcing, but with 2014 VOC emissions','piClim-VOC','30','CMIP','piControl','AGCM,AER,CHEM','','none',NULL,NULL),(25,'faf-heat','Impose surface heat flux anomalies to the ocean, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e1030-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL,'FAFMIP','AER,CHEM,BGC','','control plus perturbative surface flux of heat into ocean','faf-heat','70','CMIP','piControl','AOGCM','','none',NULL,NULL),(26,'dcppC-amv-pos','Restore the north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.','f16dd1e2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','','Idealized climate impact of positive AMV anomaly pattern','dcppC-amv-pos','10','CMIP','piControl','AOGCM','','none',NULL,NULL),(27,'amip-lfmip-pdLC','Scenario forced experiment with prescribed land surface climatology derived from \"present climate\" conditions (1980-2014) and prescribed SST (sea surface temperatures). SST configuration is taken from the AMIP runs in the DECK.','f16ec048-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','AER,CHEM,BGC','2014','prescribed land (from current climatology) and AMIP SSTs','amip-lfmip-pdLC','36','no parent','no parent','AGCM','1979','none',NULL,NULL),(28,'land-crop-grass','Land surface model simulation.  Same as land-hist except with all new crop and pasture-land treated as unmanaged grassland. Start year either 1850 or 1700 depending on standard practice for particular model.','6e270aee-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL,'LUMIP','','2014','historical land-only with cropland as natural grassland','land-crop-grass','165','no parent','no parent','LAND,BGC','1850','none',NULL,NULL),(29,'piClim-anthro','An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Anthropogenic forcing agents (greenhouse gases, aerosols and land use) are specified at present day, 2015, values. Run for 30 years.','f16f2754-dd9e-11e6-b89b-ac72891c3257','RFMIP',NULL,'01.00.28',NULL,'RFMIP','AER,CHEM','','effective radiative forcing by present day anthropogenic agents','piClim-anthro','30','CMIP','piControl','AGCM','','none',NULL,NULL),(30,'faf-passiveheat','Add a surface flux of passive tracer at the same rate as the surface heat flux perturbation, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Impose pre-industrial atmospheric conditions. Branch from the piControl at the same point as the 1pctCO2 experiment. This experiment does not affect the model evolution,  so the experiment is equivalent to the piControl with an extra diagnostic tracer.','f16e1594-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL,'FAFMIP','AER,CHEM,BGC','','control plus surface flux of passive heat tracer into ocean','faf-passiveheat','70','CMIP','piControl','AOGCM','','none',NULL,NULL),(31,'pdSST-pdSIC','Atmosphere-only time slice present day control experiment forced by climatological monthly mean sea surface temperature (SST) and sea ice concentration (SIC) for the present day. Radiative forcing to be set to present day (year 2000) levels. All necessary SST and sea ice fields will be provided to participants by PAMIP.  Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa316-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL,'PAMIP','AER,CHEM,BGC','2001','Atmosphere time slice with present day SST and SIC','pdSST-pdSIC','1','CMIP','amip','AGCM','2000','none',NULL,NULL),(32,'hist-1950','Historical coupled ocean atmosphere simulations of the near past (1950-2014) at high and standard resolution. For optimal comparison between models aerosol concentrations are recommended (rather than emissions). At least one ensemble member at high resolution, minimum atmosphere 25-50 km at mid-latitudes and ocean resolution of 0.25 degrees, and a minimum of daily coupling between ocean and atmosphere. At least one ensemble member at standard model resolution.  Initial conditions from spin-up 1950\'s experiment.','6131bbe0-4cff-11e7-903f-5404a60d96b5','HighResMIP',NULL,'01.00.28',NULL,'HighResMIP','AER','2014','coupled historical 1950-2014','hist-1950','65','HighResMIP','spinup-1950','AOGCM','1950','none',NULL,NULL),(33,'dcppC-atl-spg','Repeat DCCP-A1 hindcasts with altered initial conditions. Initialise with climatology (1960-2009 average) in the north Atlantic \"sub-polar ocean\" (95W-30E, 45N-90N).  Linear transition between climatology and actual observations over a 10 deg buffer zone (35N-45N).  10 ensemble members.  Run each member for at least 5 years, preferably 10 years.  Start dates end of 1993, 1994, 1995, 1996.  Additional start dates at end of 1992, 1997, 1998, 1999.','f16df5d2-dd9e-11e6-b89b-ac72891c3257','DCPP',NULL,'01.00.28',NULL,'DCPP','AER,CHEM,BGC','5 - 1','predictability of 1990s warming of Atlantic sub-polar gyre','dcppC-atl-spg','5','no parent','no parent','AOGCM','A ye','s1992,s1993,s1994,s1995,s1996,s1997,s1998,s1999',NULL,NULL),(34,'piClim-CH4','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of methane (CH4) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total.','70e42898-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','BGC','','pre-industrial climatological SSTs and forcing, but with 2014 methane concentrations (including chemistry)','piClim-CH4','30','CMIP','piControl','AGCM,AER,CHEM','','none',NULL,NULL),(35,'hist-resAMO','Pacemaker 20th century historical run that includes all forcings as used in CMIP6 historical simulation. Sea surface temperature (SST) is restored to the model climatology plus observational historical anomaly in the AMO domain (0-70oN, 70oW-0o). Use the same model resolutions as the CMIP6 historical simulation. The minimum number of integrations is 3, more realisations are encouraged.','f16e24c6-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL,'GMMIP','AER,CHEM,BGC','2014','initialized from \"historical\" run year 1870 and SSTs in the AMO domain (0deg-70degN, 70degW-0deg) restored to AMIP SSTs with historical forcings','hist-resAMO','145','CMIP','historical','AOGCM','1870','none',NULL,NULL),(36,'hist-all-aer2','Very like the hist-all (histALL) simulations except that they contain alternative estimates of aerosol forcing.','f16db3ec-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL,'DAMIP','AER,CHEM,BGC','2020','historical ALL-forcing run with alternate estimates of aerosol forcing','hist-all-aer2','171','CMIP','piControl','AOGCM','1850','none',NULL,NULL),(37,'piSST-4xCO2','An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) with quadrupled CO2 concentration seen by the radiation code and the vegetation code. Other atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model\'s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used. Same as piSST-control but CO2 is quadrupled. The increase in CO2 is seen by both the radiation scheme and vegetation.','f16d7d96-dd9e-11e6-b89b-ac72891c3257','CFMIP',NULL,'01.00.28',NULL,'CFMIP','AER,CHEM','','as piSST with radiation and vegetation seeing 4xCO2','piSST-4xCO2','30','CMIP','piControl','AGCM','','none',NULL,NULL),(38,'lfmip-pdLC','Scenario forced experiment with prescribed land surface climatology derived from \"present climate\" conditions (1980-2014).  The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The \"climatological\" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the historical GCM simulations. Additional ensemble members are requested with tier 2 priority.','f16eb9c2-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','AER,CHEM,BGC','2100','prescribed land conditions (from current climate climatology) and initialized from \"historical\" run year 1980','lfmip-pdLC','121','CMIP','historical','AOGCM','1980','none',NULL,NULL),(39,'ism-bsmb-std','InitMIP basal melt anomaly experiment. Apply a prescribed anomaly of basal melting rate under floating ice, provided by ISMIP6, which simulates a doubling of sub-ice-shelf melting after 40 years of simulation for models with initial melting rates close to today\'s observations. Keep the Surface Mass Balance (SMB) the same as in the ism-ctrl-std experiment.  All other model parameters and forcings are the same as those used for initialization. Neither SMB anomaly nor bedrock topography should be adjusted in response to ice-sheet geometric changes in this experiment. However, groups are encouraged to submit multiple \"physics\" ensemble members for example by changing the sliding law, stress balance approximation, model resolution, or datasets (such as using different bedrocks). ','f16ea7a2-dd9e-11e6-b89b-ac72891c3257','ISMIP6',