','36','no parent','no parent','AGCM','1979','none',NULL,NULL),(46,'pdSST-futAntSIC','Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and future Antarctic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa31d-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL,'PAMIP','AER,CHEM,BGC','2001','Atmosphere time slice with present day SST and future Antarctic SIC','pdSST-futAntSIC','1','CMIP','amip','AGCM','2000','none',NULL,NULL),(47,'volc-cluster-21C','Parallel experiment to volc-cluster-ctrl but with initial conditions from the end of the historical simulation instead of from the piControl. The first eruption of the cluster begins in 2015. All external forcings, except volcanic forcing are from the 21st-century SSP2-4.5 scenario experiment of ScenarioMIP. At the end of the volcanic cluster, volcanic forcing input shall be kept constant at the same constant value prescribed for the piControl simulation for consistency with the SSP2-4.5 scenario experiment. At least one, preferably three ensemble members. 85 years for each ensemble member.','f16fb64c-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL,'VolMIP','AER,CHEM,BGC','2100','volcanic cluster experiment under 21st century SSP2-4.5 scenario','volc-cluster-21C','86','CMIP','historical','AOGCM','2015','none',NULL,NULL),(48,'ism-asmb-std','InitMIP surface mass balance (SMB) anomaly experiment. Apply a prescribed SMB anomaly, provided by ISMIP6,  which mimics the expected SMB change from the end of the 20th century to the end of the 21st century. Al