979','none',NULL,NULL),(65,'pdSST-futBKSeasSIC','Atmosphere-only time slice experiment to investigate regional forcing. Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day and future Arctic sea ice concentration (SIC) only in the Barents and Kara Seas. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.','661fa326-4e15-11e8-be0a-1c4d70487308','PAMIP',NULL,'01.00.28',NULL,'PAMIP','AER,CHEM,BGC','2001','Atmosphere time slice with present day SST and future Barents and Kara Seas SIC','pdSST-futBKSeasSIC','1','CMIP','amip','AGCM','2000','none',NULL,NULL),(66,'volc-long-eq','Idealised equatorial eruption corresponding to an initial emission of 56.2 Tg of SO2. This eruption has a magnitude roughly corresponding to the 1815 Mt Tambora eruption in Indonesia, which was linked to the so-called \"year without a summer\" in 1816.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years','f16f8a00-dd9e-11e6-b89b-a