e model climatology plus observational historical anomaly in the tropical lobe of the IPO domain (20oS-20oN, 175oE-75oW). Use the same model resolutions as the CMIP6 historical simulation. Minimum number of integrations is 3, more realisations are encouraged.','f16e20ca-dd9e-11e6-b89b-ac72891c3257','GMMIP',NULL,'01.00.28',NULL,'GMMIP','AER,CHEM,BGC','2014','initialized from \"historical\" run year 1870 and SSTs in tropical lobe of the IPO domain (20degS-20degN, 175degE-75degW) restored to AMIP SSTs with historical forcings','hist-resIPO','145','CMIP','historical','AOGCM','1870','none',NULL,NULL),(79,'land-hist-altStartYear','Land surface model simulation. Same as land-hist except starting from either 1700 (for models that typically start in 1850) or 1850 (for models that typically start in 1700).   Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active.  Forced with historical observed climate. Include transient CO2, Nitrogen deposition, aerosol deposition and population density. This experiment can and likely will be a different configuration across models due to different representations of land use for each model.','6e271200-4c5a-11e7-903f-5404a60d96b5','LUMIP',NULL,'01.00.28',NULL,'LUMIP','','2014','historical land-only alternate start year','land-hist-altStartYear','165','no parent','no parent','LAND,BGC','1850','none',NULL,NULL),(80,'hist-GHG','Historical greenhouse-gas only simulations resemble the historical simulations but instead are forced by well-mixed greenhouse gas changes only. Models with interactive chemistry schemes should either turn off the chemistry or use a preindustrial climatology of stratospheric and tropospheric ozone in their radiation schemes.  This will ensure that ozone is fixed in all these simulations, and simulated responses in models with and without coupled chemistry are comparable. Report what sets of emissions and boundary conditions are used.','f16d8f5c-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL,'DAMIP','AER,CHEM,BGC','2020','historical well-mixed GHG-only run','hist-GHG','171','CMIP','piControl','AOGCM','1850','none',NULL,NULL),(81,'volc-pinatubo-slab','1991 Pinatubo forcing as used in the CMIP6 historical simulations.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years. Use a model configuration with a slab ocean.','f16fa8e6-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL,'VolMIP','AER,CHEM,BGC','','Pinatubo experiment with slab ocean','volc-pinatubo-slab','3','VolMIP','control-slab','AGCM,SLAB','','none',NULL,NULL),(82,'ssp370SST-lowCH4','SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced  methane emissions. SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70. ','70e40c46-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','BGC','2055','SSP3-7.0, prescribed SSTs, with low methane concentrations','ssp370SST-lowCH4','41','ScenarioMIP','ssp370','AGCM,AER,CHEM','2015','none',NULL,NULL),(83,'amip-lwoff','Continuation of CFMIP-2 AMIP experimen