an of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Its dominant feature is the increase in westerly windstress in the Southern Ocean. Impose pre-industrial atmospheric conditions.  Branch from the piControl at the same point as the 1pctCO2 experiment.','f16e0c20-dd9e-11e6-b89b-ac72891c3257','FAFMIP',NULL,'01.00.28',NULL,'FAFMIP','AER,CHEM,BGC','','control plus perturbative surface flux of momentum into ocean','faf-stress','70','CMIP','piControl','AOGCM','','none',NULL,NULL),(104,'1pctCO2to4x-withism','Increase atmospheric carbon dioxide by 1% per year to quadrupling then hold fixed for 200 years in a model with interactive ice sheets. The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets. 1pctCO2to4x-withism forcing differs from the 1% increase in CO2 experiment in that  after year 140 , when the CO2 levels = 4xCO2, the concentration of CO2 remains set to 4xCO2 for the remainder of the experiment Run for a minimum of 350 years (500 years encouraged).','f16e76a6-dd9e-11e6-b89b-ac72891c3257','ISMIP6',NULL,'01.00.28',NULL,'ISMIP6','AER,CHEM,BGC','','simulation with interactive ice sheet forced by 1 percent per year increase in CO2 to 4xCO2 (subsequently held fixed)','1pctCO2to4x-withism','350','ISMIP6','piControl-withism','AOGCM,ISM','','none',NULL,NULL),(105,'piClim-HC','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of ozone depleting halocarbons (ODS) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total. Only models with stratospheric chemistry should run this experiment.','70e42f5a-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','BGC','','pre-industrial climatological SSTs and forcing, but with 2014 halocarbon 