eton','Land only simulations using Princeton forcing data and a standard bias correction strategy. As LUMIP land-hist but with princeton forcing dataset. The Princeton Global Forcing data is based on NCEP-NCAR reanalysis data. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eb0c6-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','BGC','2014','as land-hist with Princeton forcings','land-hist-princeton','165','no parent','no parent','LAND','1850','none',NULL,NULL),(143,'volc-cluster-mill','Parallel experiment to volc-cluster-ctrl but with initial conditions taken from last-millennium simulation to account for the effects of a more realistic history of past natural forcing.  Initialisation on 1 January 1790 to avoid interferences due to the decadal drop of solar activity associated with the Dalton Minimum.  The first eruption of the cluster begins in 1809 as in volc-cluster-ctrl. All external forcings, except volcanic forcing, are set as a perpetual repetition of the year 1790 for the full duration of the experiment. At least one, preferably three, ensemble members.  69 years for each ensemble member.','f16fa5b2-dd9e-11e6-b89b-ac72891c3257','VolMIP',NULL,'01.00.28',NULL,'VolMIP','AER,CHEM,BGC','1858','19th century volcanic cluster initialized from past1000','volc-cluster-mill','69','PMIP','past1000','AOGCM','1790','none',NULL,NULL),(144,'piClim-NOx','Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of NOx, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total.','70e432a2-54ca-11e7-a104-5404a60d96b5',