t interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.','70e44dc8-54ca-11e7-a104-5404a60d96b5','AerChemMIP',NULL,'01.00.28',NULL,'AerChemMIP','CHEM,BGC','','pre-industrial climatological SSTs and forcing, but with doubled emissions from fires','piClim-2xfire','30','CMIP','piControl','AGCM,AER','','none',NULL,NULL),(172,'ssp245-stratO3','Extension of stratospheric-ozone-only run, hist-stratO3, under SSP2-4.5 forcing to the year 2100. In models with coupled chemistry, he chemistry scheme should be turned off, and the simulated ensemble mean monthly mean 3D stratospheric ozone concentrations from the SSP2-4.5 simulations should be prescribed. Tropospheric ozone should be fixed at 3D long-term monthly mean piControl values, with a value of 100 ppbv ozone concentration in this piControl climatology used to separate the troposphere from the stratosphere.   In models without coupled chemistry the same stratospheric ozone prescribed in SSP2-45 should be prescribed. Stratospheric ozone concentrations will be provided by CCMI.','f16d9f60-dd9e-11e6-b89b-ac72891c3257','DAMIP',NULL,'01.00.28',NULL,'DAMIP','AER,BGC','2100','stratospheric-ozone-only SSP2-4.5 run','ssp245-stratO3','80','DAMIP','hist-stratO3','AOGCM','2021','none',NULL,NULL),(173,'ssp370','Gap: Baseline scenario with a medium to high radiative forcing by the end of century. Following approximately RCP7.0 global forcing pathway with SSP3 socioeconomic conditions. Radiative forcing reaches a level of 7.0 W/m2 in 2100.  Concentration-driven.','f16f5ab2-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL,'ScenarioMIP,AerChemMIP','AER,CHEM,BGC','2100','gap-filling scenario reaching 7.0 based on SSP3','ssp370','86','CMIP','historical','AOGCM','2015','none',NULL,NULL),(174,'histSST-piAer','Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Aerosol emissions (exce