,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,121),(288,'ssp126-WACCM','SSP-based RCP scenario with low radiative forcing by the end of the century.  Following approximately RCP2.6 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 2.6 W/m2 in 2100. Concentration-driven.','f16f6188-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.26',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14),(289,'esm-yr2010CO2-control','Forced with CO2 emissions diagnosed from historical and yr2010CO2 simulations and all other forcings the same as in that simulation (part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15ca-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2115','historical emissions followed by fixed 2010 emissions (both model-diagnosed)','esm-yr2010CO2-control','266','CDRMIP','esm-piControl','AOGCM,BGC','1850','none',NULL,NULL),(290,'land-ssp126','Offline land surface simulations forced with ScenarioMIP SSP1-26.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','7c2bb5fe-c8a0-11e8-8bae-a44cc8186c64','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','BGC','2100','future ssp1-2.6 land only','land-ssp126','86','no parent','no parent','LAND','2015','none',NULL,NULL),(291,'esm-yr2010CO2-noemit','Upon initialization from end of year 2015 of esm-yr2010-control CO2 emissions are fixed at zero; all other forcing fixed at 2010 level (part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d4-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2115','branches from esm-yr2010CO2-control with zero emissions','esm-yr2010CO2-noemit','101','CDRMIP','esm-yr2010CO2-control','AOGCM,BGC','2015','none',NULL,NULL),(292,'esm-ssp585-ocn-alk','emission driven SSP5-8.5 scenario with 0.14 Pmol/yr alkalinity added to ice free ocean surface waters from 2020 optionally extended from 2100 to 2300 (part of the CDR-ocean-alk experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15cb-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2100 ','emission-driven SSP5-8.5 scenario but with ocean alkalinization from year 2020 onward','esm-ssp585-ocn-alk','81','C4MIP','esm-ssp585','AOGCM,BGC','2020','none',NULL,NULL),(293,'1pctCO2-cdr','1 percent per year decrease in CO2 (immediately after reaching 4xCO2 in the 1pctCO2 simulation); then held constant at pre-industrial level for as long as possible (part of the CDR-reversibility experiment). CO2 concentration prescribed.','56ed15cc-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','','1 percent per year decrease in CO2 from 4xCO2','1pctCO2-cdr','200','CMIP','1pctCO2','AOGCM,BGC','','none',NULL,NULL),(294,'esm-pi-CO2pulse','100 Gt C instantly added (positive pulse) to a pre-industrial atmosphere (part of the CDR-pi-pulse experiment). CO2 concentration calculated (i.e. freely evolving).','56ed15cd-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','','pulse addition of 100 Gt carbon to pre-industrial atmosphere','esm-pi-CO2pulse','100','CMIP','esm-piControl','AOGCM,BGC','','none',NULL,NULL),(295,'esm-ssp585ext','Long term extension of CO2 emissions driven SSP5-8.5 scenario (used in the CDR-afforestation and CDR-ocean-alk experiments). All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15cf-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2300','emission-driven long-term extension of the SSP5-8.5 scenario','esm-ssp585ext','200','C4MIP','esm-ssp585','AOGCM,BGC','2101','none',NULL,NULL),(296,'esm-ssp585-ssp126Lu-ext','Long term extension of CO2 emissions driven SSP5-8.5 with SSP1-2.6 land use forcing (part of the CDR-afforestation experiment). All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). ','56ed15d0-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2300','extension of the LUMIP emissions-driven simulation following SSP5-8.5 with SSP1-2.6 land use','esm-ssp585-ssp126Lu-ext','200','LUMIP','esm-ssp585-ssp126Lu','AOGCM,BGC','2101','none',NULL,NULL),(297,'esm-pi-cdr-pulse','100 Gt C instantly removed (negative pulse) from a pre-industrial atmosphere (part of the CDR-pi-pulse experiment). CO2 concentration calculated (i.e. freely evolving).','56ed15d1-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','','pulse removal of 100 Gt carbon from pre-industrial atmosphere','esm-pi-cdr-pulse','100','CMIP','esm-piControl','AOGCM,BGC','','none',NULL,NULL),(298,'esm-ssp534-over','CO2 emissions driven SSP5-3.4 overshoot scenario simulation optionally extending to year 2300 (part of the CDR-overshoot experiment). The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15d2-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2100 ','emission-driven SSP5-3.4-OS scenario','esm-ssp534-over','61','C4MIP','esm-ssp585','AOGCM,BGC','2040','none',NULL,NULL),(299,'esm-yr2010CO2-cdr-pulse','Upon initialization from end of year 2015 of esm-yr2010CO2-control instantaneously remove 100 Gt C (\"negative pulse\"; part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d3-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2115','instantaneous 100 Gt C removal from industrial era atmosphere','esm-yr2010CO2-cdr-pulse','101','CDRMIP','esm-yr2010CO2-control','AOGCM,BGC','2015','none',NULL,NULL),(300,'land-ssp434','Offline land surface simulations forced with ScenarioMIP SSP4-34.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','21d8e3e4-7ed4-11e8-b252-1c4d70487308','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','BGC','2100','future ssp4-3.4 land only','land-ssp434','86','no parent','no parent','LAND','2015','none',NULL,NULL),(301,'land-ssp585','Offline land surface simulations forced with ScenarioMIP SSP5-85.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.','f16eb5f8-dd9e-11e6-b89b-ac72891c3257','LS3MIP',NULL,'01.00.28',NULL,'LS3MIP','BGC','2100','future ssp5-8.5 land only','land-ssp585','86','no parent','no parent','LAND','2015','none',NULL,NULL),(302,'esm-yr2010CO2-CO2pulse','Upon initialization from end of year 2015 of esm-yr2010CO2-control instantaneously introduce 100 Gt C (\"positive pulse\"; part of the CDR-yr2010-pulse experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d5-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2115','instantaneous 100 Gt C addition to an industrial era atmosphere','esm-yr2010CO2-CO2pulse','101','CDRMIP','esm-yr2010CO2-control','AOGCM,BGC','2015','none',NULL,NULL),(303,'esm-ssp585-ocn-alk-stop','Simulation of abrupt termination of ocean alkalinsation in 2070 during an emission driven SSP5-8.5 scenario (part of the CDR-ocean-alk experiment).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).','56ed15ce-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2100','emission-driven SSP5-8.5 scenario with alkalinization terminated in year 2070','esm-ssp585-ocn-alk-stop','31','CDRMIP','esm-ssp585-ocn-alk','AOGCM,BGC','2070','none',NULL,NULL),(304,'yr2010CO2','Branch from beginning of year 2010 of the historical simulation with CO2 concentration and all other forcing held fixed at 2010 level (part of the CDR-yr2010-pulse experiment to diagnose CO2 emissions).  All anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). In this experiment CO2 is first prescribed to diagnose emissions; however, the key simulations calculate the CO2 concentration.','56ed15d6-b104-11e8-96ca-1c4d70487308','CDRMIP',NULL,'01.00.28',NULL,'CDRMIP','AER,CHEM','2115','concentration-driven fixed 2010 forcing','yr2010CO2','106','CMIP','historical','AOGCM,BGC','2010','none',NULL,NULL),(305,'ssp534-over-WACCM','Gap: Mitigated overshoot scenario with medium/low radiative forcing by the end of the 21st century.  The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.','f16f73f8-dd9e-11e6-b89b-ac72891c3257','ScenarioMIP',NULL,'01.00.28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,248);
